import React from 'react';

function Authenticate() {
    return (
        <div>
            <div>
                <h1>Register</h1>
                <input placeholder="username" />
                <input placeholder="password" />
                <button>Submit</button>
            </div>



        </div>
    );
}


export default Authenticate;
